script: |
  super -f text -I q332.spq | sort > q332.out

inputs:
  - name: q332.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN - col0 AND - CAST ( + - col1 AS INTEGER ) * col1 + + 99 * + col2 + + - col0;
  - name: tab2

outputs:
  - name: q332.out
    data: |
